import React, { useState, useEffect } from "react";
import { useNavigate, Link } from "react-router-dom";
import { jwtDecode } from "jwt-decode"; // ✅ ใช้ jwtDecode ตรวจสอบสิทธิ์
import "./Sidebar.css"; // ✅ ใช้ CSS สำหรับแสดง/ซ่อนเมนู

const Sidebar = () => {
    const [isOpen, setIsOpen] = useState(false); // ✅ ควบคุมการแสดงผล Sidebar
    const [isSuperAdmin, setIsSuperAdmin] = useState(false); // ✅ ตรวจสอบสิทธิ์
    const [userName, setUserName] = useState("");
    const [role, setRole] = useState("");
    const [branchName, setBranchName] = useState("");
    const navigate = useNavigate();

    useEffect(() => {
        const token = localStorage.getItem("token");
        if (token) {
            try {
                const user = jwtDecode(token);
                setIsSuperAdmin(user.isSuperAdmin);
                setUserName(user.name || "ไม่ทราบชื่อ");
                setRole(user.isSuperAdmin ? "SuperAdmin" : "Employee");
                setBranchName(user.branch_name || "ไม่ระบุสาขา");
            } catch (error) {
                console.error("🔴 Error decoding token:", error);
                localStorage.removeItem("token"); // ✅ ถ้า Token ใช้ไม่ได้ ให้ลบออก
                navigate("/login"); // ✅ กลับไปหน้า Login
            }
        }
     else {
        navigate("/login");}
    
    }, [navigate]);

    const handleLogout = () => {
        localStorage.removeItem("token"); // ✅ ลบ Token
        navigate("/login"); // ✅ Redirect ไปหน้า Login
    };

    return (
        <div className={`sidebar-container ${isOpen ? "open" : ""}`}>
            {/* ปุ่ม Toggle เมนู */}
            <button className="menu-toggle" onClick={() => setIsOpen(!isOpen)}>
                {isOpen ? "❌ ปิด" : "☰ เมนู"}
            </button>

            {/* ✅ เมนูด้านข้าง */}
            <div className="sidebar">
                <h2>🔹 เมนูหลัก</h2>
                <ul>
                    <li><Link to="/Dashboard">🏠 หน้าหลัก</Link></li>
                    <li><Link to="/queue">📋 จัดการคิวงาน</Link></li>
                    <li><Link to="/appointments">📅 จัดการนัดหมาย</Link></li>
                    <li><Link to="/payments">💳 ชำระเงิน</Link></li>
                    <li><Link to="/payouts">💸 บันทึกรายจ่าย</Link></li>
                    <li><Link to="/services">🛠 บริการ</Link></li>
                    <li><Link to="/reports">📊 รายงาน</Link></li>

                    {/* ✅ เมนูพิเศษสำหรับ SuperAdmin เท่านั้น */}
                    {isSuperAdmin && (
                        <>
                            <li><Link to="/employee">👥 จัดการพนักงาน</Link></li>
                            <li><Link to="/branch">🏢 จัดการสาขา</Link></li>
                            <li><Link to="/users">🧑‍💼 ผู้ใช้งาน</Link></li>
                        </>
                    )}
                </ul>

                {/* ✅ ปุ่มออกจากระบบ */}
                <button className="logout-button" onClick={handleLogout}>
                    🚪 ออกจากระบบ
                </button>
            </div>
        </div>
    );
};

export default Sidebar;
